import React from 'react';

function Login() {
    return(
            <form name={`${props.name}`} className="popup__container" onSubmit={props.onSubmit}>
                <h2 className={`popup__container-name ${props.decoration}`}>{props.title}</h2>
                {props.children}
                <button type="submit" className="popup__container-submit-button popup__container-submit-button" >Войти</button>
            </form>
    );
}

export default Login;
